							 F@_4, TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_RequestBeginBlock(Rest, 0, 0, F@_1, F@_2,
					      F@_3, F@_4, TrUserData);
	    1 ->
		skip_64_RequestBeginBlock(Rest, 0, 0, F@_1, F@_2, F@_3,
					  F@_4, TrUserData);
	    2 ->
		skip_length_delimited_RequestBeginBlock(Rest, 0, 0,
